import { NavLink } from 'react-router-dom'
const Header = () => {
  const getToken = localStorage.getItem('token-info')
  console.log("h-getToken", getToken)

  return (
    <div class="topnav">
      <NavLink className={({ isActive }) => `nav-link${isActive ? ' active' : ''}`} to="home">Home</NavLink>
      <NavLink className={({ isActive }) => `nav-link${isActive ? ' active' : ''}`} to="confidential">Confidential</NavLink>
      {!getToken ? <NavLink className={({ isActive }) => `nav-link${isActive ? ' active' : ''}`} to="login">login</NavLink> :
        <NavLink className={({ isActive }) => `nav-link${isActive ? ' active' : ''}`} to="logout">Logout</NavLink>}
      {getToken && <NavLink className={({ isActive }) => `nav-link${isActive ? ' active' : ''}`} to="help">Help</NavLink>}

    </div>)
}

export default Header
